import React, { useEffect } from 'react'
import { useState } from 'react';
import { Table,Button } from 'antd';
import url from '../components/host';
import  axios  from 'axios';
import "./style/additional.css"
import { AiOutlineClose } from "react-icons/ai";

export default function Additional() {
  const [data, setdata] = useState()


  const columns = [
    {
      title: 'Id',
      dataIndex: 'id',
    },
    {
      title: 'Name',
      witdh:"5%",
      dataIndex: 'name',
    },

    {
      title: 'Edit',
      witdh:"5%",
      render: () => {
        return <div>
          <Button  style={{  background: 'orange', color: 'white' }} type="button">O'zgartirish</Button>
        </div>
    }
  },
  {
    title: 'Delet',
    witdh:"5%",
    render: (key) => {
      return <div>
        <Button onClick={()=>deletee(key.id)} type="danger">O'chirish</Button>
      </div>
  },
}
  ];


  useEffect(()=>{
    axios.get(`${url}/api/fuel_sort/`).then(res=>{
      setdata(res.data)
    }).catch(err=>{
      console.log(err);
    })
  },[])

  function deletee(id){
  axios.delete(`${url}/api/fuel_sort/${id}/`, { headers: { 'Authorization': 'Bearer ' + sessionStorage.getItem("token") } }).then(res=>{
    alert("O'chirildi")
    window.location.reload()
  }).catch(err=>{
    alert("ochirilmadi")
    console.log(err);
  })
  }

  function postoyna(){
    document.querySelector(".postoyna").style="position: fixed;top: 0%;    transition: 1s;"
  }
  function postoynaclose(){
    document.querySelector(".postoyna").style="position: fixed;top: -100%;    transition: 1s;"
  }


  return (
    <div>
      <div className="house">
        <button onClick={()=>postoyna()} className='post'>Post</button>
      <Table className='table' columns={columns} dataSource={data} />
      </div>







      <div className="postoyna">
        <AiOutlineClose onClick={()=>postoynaclose()} />
        <p>Yoqilg'i turini kiriting</p>
        <input type="text" />
        <button className='post'></button>
      </div>
    </div>
  )
}
